import React from "react";
import { connect } from "react-redux";
import classes from "./Previous.module.css";
const Previous = props => {
  let data, keys, list;
  if (props.data !== undefined) {
    data = props.data;
    keys = Object.keys(data);
  }
  if (props.isLogged) {
    const loggedUser = "naveen";
    list = keys.map(key => {
      if (data[key][loggedUser] === undefined) return;
      return <MessageCard id={key} message={data[key][loggedUser].message} />;
    });
  } else {
    list = <p>Login to conversations</p>;
  }
  return <div className={classes.messages}>{list}</div>;
};
const mapStateToProps = state => ({
  data: state.data,
  isLogged: state.isLogged
});

const MessageCard = props => {
  return <div className={classes.card}>{props.message}</div>;
};
export default connect(
  mapStateToProps,
  null
)(Previous);
